        private static int getWordPy(StringBuilder sb, int index)
        {
            var start = wordIndex[index];
            var end = wordIndex[index + 1];
            for (int i = start; i < end; i++) {
                sb.Append(pyName[wordPy[i]]);
            }
            return end - start;
        }

